css:
@-moz-document domain("textures.one") {
.indexTop {
    background: url("https://pixabay.com/get/e034b0082ffc1c22d9584518a33219c8b66ae3d01cb6144092f6c27f/banner-911778_1920.jpg");
    background-size: cover;
    background-position: center;
}
.header-link a,
.header-link a:visited {
    background: rgba(0, 0, 0, .79);
    color: #6f6f6f !important;
    border-radius: 3px;
}
.header-link a:hover {
    color: #a6a6a6 !important;
}
body,
.listButtons {
    background: #1e1e1e;
    color: #c8c8c8;
    text-shadow: 2px 2px 3px black;
}
input {
    background: #333 !important;
    box-shadow: inset 0px 0px 4px 0px;
}
button,
select {
    background: #143551 !important;
}

a:link {
    color: #1d496ff2;
}
a:hover {
    color: #2c70aef2;
}
}
